import React, { useState } from "react";
import "./storeshoe.css";
import cart from "../images/carticon.png";
import { useParams } from "react-router-dom";
import { Shoedata } from "./Shoedata";
import { Cartdata } from "./Cartdata.js";
import { NavLink } from "react-router-dom";

const Storeshoe = () => {
  const idm = useParams("");

  console.log("this is id", idm);

  const [selected, setSelected] = useState("");

  const obj = {};

  const handleChange = (e) => {
    setSelected(e.target);
  };

  const addtocart = (e) => {
    console.log(e.target.value);
    Cartdata.push(e.target);
  };
  return (
    <div>
      <div className="shoe">
        <div className="left">
          <div className="leftheader">
            <NavLink exact to={`/allproducts`}>
              <p>&#8249;</p>
            </NavLink>
            <p className="designp">your design space</p>
          </div>

          {Shoedata.map((e) => {
            if (e.id === idm.id) {
              return (
                <div className="leftbody">
                  <div className="limage">
                    <img src={e.url} alt=""></img>
                  </div>
                  <div className="limages">
                    <img src={e.url} alt=""></img>
                    <img src={e.url} alt=""></img>
                    <img src={e.url} alt=""></img>
                  </div>
                  <div className="rdetails">
                    <div>
                      <h1>{e.name}</h1>
                      <h2>by KICKSUP and you</h2>
                    </div>
                    <div>
                      <p>star</p>
                      <p>{e.review}</p>
                    </div>
                    <div>
                      <h2>{e.price}</h2>
                      <p>get an exclusive 20% off shopingith HDFC bank</p>
                    </div>

                    <div className="boxes">
                      <h5>Front</h5>
                      <div className="box">
                        <input
                          type="checkbox"
                          value="option1"
                          checked={selected === "option1"}
                          onChange={handleChange}
                        />
                      </div>
                      <div className="box">
                        <input
                          type="checkbox"
                          value="option2"
                          checked={selected === "option2"}
                          onChange={handleChange}
                        />
                      </div>
                      <div className="box">
                        <input
                          type="checkbox"
                          value="option3"
                          checked={selected === "option3"}
                          onChange={handleChange}
                        />
                      </div>
                    </div>
                    <div className="boxes">
                      <h5>Middle</h5>
                      <div className="box">
                        <input
                          type="checkbox"
                          value="middle1"
                          checked={selected === "middle1"}
                          onChange={handleChange}
                        />
                      </div>
                      <div className="box">
                        <input
                          type="checkbox"
                          value="middle2"
                          checked={selected === "middle2"}
                          onChange={handleChange}
                        />
                      </div>
                      <div className="box">
                        <input
                          type="checkbox"
                          value="middle3"
                          checked={selected === "middle3"}
                          onChange={handleChange}
                        />
                      </div>
                    </div>
                    <div className="boxes">
                      <h5>Back</h5>
                      <div className="box">
                        <input
